import React, { useEffect } from 'react';
import Cube from '../components/Cube';
import { Link } from 'react-router-dom';
import './Home.css';

const Home = () => {
  useEffect(() => {
    // Function to animate letters
    const animateLetters = () => {
      const letters = document.querySelectorAll('.title-container h1 span');

      letters.forEach((letter, index) => {
        setTimeout(() => {
          letter.style.transition = 'opacity 0.3s ease, transform 0.3s ease';
          letter.style.opacity = 1;
          letter.style.transform = 'translateX(0)';
        }, 500 * index);
      });
    };

    // Call the animation function when the page is loaded
    animateLetters();

    // Cube interaction logic
    const cube = document.querySelector('.cube');
    let isClockwise = true;

    const handleClick = () => {
      if (isClockwise) {
        cube.classList.remove('rotate-clockwise');
        cube.classList.add('rotate-counterclockwise');
      } else {

        cube.classList.add('rotate-clockwise');
        cube.classList.remove('rotate-counterclockwise');
      }
      isClockwise = !isClockwise;
    };

    let startX = 0;
    let startY = 0;

    const handleTouchStart = (e) => {
      const touch = e.touches[0];
      startX = touch.clientX;
      startY = touch.clientY;
    };

    const handleTouchEnd = (e) => {
      const touch = e.changedTouches[0];
      const endX = touch.clientX;
      const endY = touch.clientY;
      const diffX = endX - startX;
      const diffY = endY - startY;

      if (Math.abs(diffX) > Math.abs(diffY)) {
        if (diffX > 0) {
          // Swiped right
          cube.classList.remove('rotate-counterclockwise');
          cube.classList.add('rotate-clockwise');
        } else {
          // Swiped left
          cube.classList.remove('rotate-clockwise');
          cube.classList.add('rotate-counterclockwise');
        }
      } else {
        if (diffY > 0) {
          // Swiped down
          cube.classList.remove('rotate-counterclockwise');
          cube.classList.add('rotate-clockwise');
        } else {
          // Swiped up
          cube.classList.remove('rotate-clockwise');
          cube.classList.add('rotate-counterclockwise');
        }
      }
      isClockwise = !isClockwise;
    };

    cube.addEventListener('click', handleClick);
    cube.addEventListener('touchstart', handleTouchStart);
    cube.addEventListener('touchend', handleTouchEnd);

    return () => {
      cube.removeEventListener('click', handleClick);
      cube.removeEventListener('touchstart', handleTouchStart);
      cube.removeEventListener('touchend', handleTouchEnd);
    };
  }, []);

  return (
    <div className="home-container">
      <div className="background-image"></div>
      <div className="title-container">
        <h1>
          <span>S</span>
          <span>o</span>
          <span>f</span>
          <span>t</span>
          <span style={{ color: '#ff6600' }}>D</span>
          <span>r</span>
          <span>a</span>
          <span>k</span>
          <span>u</span>
          <span>l</span>
          <span>a</span>
          <span style={{ fontSize: 'large' }}>&copy;</span>
        </h1>
        <h2 id="caveira-hippie">Your Gateway to Digital Excellence</h2>
        <br /><br /><br />
        <section>
          <div className="cube-container">
            <Cube />
          </div>
        </section>
        <br /><br /><br />
      </div>
      <div className="container">
        <div className="row">
          <nav className="col-md-3">
            <ul className="menu">
              <li><Link to="/">Home</Link></li>
              <li><Link to="/about">About</Link></li>
